class Solution {
public:
    int maxOperations(string s) {
        int ret = 0, one = 0;
        for (int i = 0; i < s.size(); i++)
            if (s[i] == '1')
                one++;
            else if (i + 1 == s.size() || s[i + 1] == '1')
                ret += one;
        return ret;
    }
};
